const theme = {
    labels: { text: { fontSize: 14, fill: "black" } },
    axis: {
      ticks: {
        text: { fontSize: 13, fill: "white" },
        line: { strokeWidth: 0 },
      },
      legend: { text: { fontSize: 15, fill: "white" } },
      domain: { line: { strokeWidth: 2, stroke: "white" } },
    },
    legends: {
      text: { fontSize: 15, fill: "white" },
    },
    grid: {
      line: { strokeWidth: 0 },
    },
  };

export default theme;
